  false,\n\t\"url\": null,\n\t\"notes\": \"Used ElevationDEM_DEM10M and the Arc/Info
  ASPECT command to create this data layer representing compass direction of the aspect
  (rounded to whole numbers). Input source dataset is derived from the multi-resolution
  National Elevation Dataset (NED), at resolutions of both 1/3 arc-second (approx.
  10 meters) and in limited areas, 1/9 arc-second (approx. 3 meters). VCGI extracted
  the Vermont portion of the NED and re-projected into Vermont State Plane Meters
  NAD83 (vertical units in feet). Production artifacts were filtered out of this source
  data prior to acquisition resulting in a much-improved base of elevation data for
  calculating contours, slope and hydrologic derivatives. The NED is the primary elevation
  data product produced and distributed by the USGS. The NED provides the best available
  public domain raster elevation data of the conterminous United States, Alaska, Hawaii,
  and territorial islands in a seamless format. The NED is derived from diverse source
  data, processed to a common coordinate system and unit of vertical measure. The
  source data are distributed in geographic coordinates in units of decimal degrees,
  and in conformance with the North American Datum of 1983 (NAD 83). The source elevation
  values are provided in units of meters, and are referenced to the North American
  Vertical Datum of 1988 (NAVD 88) over the conterminous United States.\",\n\t\"owner_org\":
